import React from 'react';
import './Navbar.css';
import { NavLink } from 'react-router-dom'

import { IoHomeOutline } from "react-icons/io5";
import { RiLogoutBoxRLine } from "react-icons/ri";
import { ImProfile } from "react-icons/im";


const USerNavbar = (props) => {

    return (
        <div className="Navbar">
            <div className="nav-icons">
                {props.iconName==="home" && <IoHomeOutline color="#6155a6" fontSize="30px" />} 
                {props.iconName==="profile" && <ImProfile color="#6155a6" fontSize="30px" />}   
                {props.iconName==="upload" && <RiLogoutBoxRLine color="#6155a6" fontSize="25px" />} 
            </div>

            <div>
                <NavLink exact to="/feed" activeStyle={{
                    fontWeight: "bold",
                    color: "#6155a6"
                }}>
                    Home
                </NavLink>
                <NavLink exact to="/profile" activeStyle={{
                    fontWeight: "bold",
                    color: "#6155a6"
                }}>
                   Profile
                </NavLink>
                <NavLink exact to="/" activeStyle={{
                    fontWeight: "bold",
                    color: "#6155a6"
                }}>
                   Upload
                </NavLink>
            </div>
        </div>
    );

}

export default USerNavbar;
